import { Toolbar } from "../../src/document-editor-container/tool-bar/tool-bar"
import { createElement } from "@syncfusion/ej2-base";
import { TestHelper } from "../test-helper.spec";
import { DocumentEditor } from "../../src/document-editor/document-editor";
import { Editor } from "../../src/document-editor/implementation/editor/editor";
import { Selection } from '../../src/document-editor/implementation/selection/selection';
import { EditorHistory } from "../../src/document-editor/implementation/editor-history/editor-history";
import { SfdtExport } from "../../src/document-editor/implementation/writer/sfdt-export";
import { WordExport } from "../../src/document-editor/implementation/writer/word-export";
var text: string = '{"sfdt":""}';
describe('Document Opening cases - test all document ', () => {
    let container: DocumentEditor;
    beforeAll(() => {
        
        let ele: HTMLElement = createElement('div', { id: 'container' });
        document.body.appendChild(ele);
        DocumentEditor.Inject(Selection, Editor, EditorHistory, SfdtExport, WordExport);
        container = new DocumentEditor({ isReadOnly: false });
        container.documentEditorSettings.showHiddenMarks = true;
        container.enableAllModules();
        (container.documentHelper as any).containerCanvasIn = TestHelper.containerCanvas;
        (container.documentHelper as any).selectionCanvasIn = TestHelper.selectionCanvas;
        (container.documentHelper.render as any).pageCanvasIn = TestHelper.pageCanvas;
        (container.documentHelper.render as any).selectionCanvasIn = TestHelper.pageSelectionCanvas;
        container.appendTo('#container');
    });
    afterAll((done): void => {
        container.destroy();
        document.body.removeChild(document.getElementById('container'));
        container = undefined;
        
        setTimeout(function () {
            done();
        }, 1000);
    });

    it('test-all document opening', () => {
        console.log('test-all document opening');
        container.open(text);
        var length = container.documentHelper.pages.length;
        for (let i = 0; i < length; i++) {
            container.exportAsPath(i + 1);
        }
        expect(container.documentHelper.pages.length).not.toBe(0);
    });
    it('Export as word - test-all document', () => {
        console.log('Export as word - test-all document');
        expect(() => { container.save('test-all', 'Docx') }).not.toThrowError();

    });
    it('Export as SFDT - test-all document', () => {
        console.log('Export as SFDT - test-all document');
        expect(() => { container.save('test-all', 'Sfdt') }).not.toThrowError();

    });
});
